import React from 'react';
import "./footer.css"


function Footer() {
    return (
      <footer className="footer">
      <p>&copy; 2024 Your Company. All rights reserved.</p>
      <div className="footer-links">
          <a href="#">Privacy Policy</a>
          <a href="#">Terms of Service</a>
          <a href="#">Contact Us</a>
      </div>
  </footer>


    );
}

export default Footer;
